import Vue from 'vue'
import Router from 'vue-router'
import HelloContainer from "./components/HelloWorld.vue"
import Home from "./components/Home.vue"
import product from "./components/product.vue"
import book_list from "./components/book_list.vue"
import Oneline from "./components/Oneline.vue"
import trade from "./components/trade.vue"
import BookMall from "./components/BookMall.vue"
import Bookul from "./components/Bookul.vue"
import Login from "./components/Login.vue"
//1:引入自定义组件 
//1.找到vue文件位置引入
Vue.use(Router)
//2:配置访问自定义组件路径
//   {path访问路径 component  组件名称}
export default new Router({
  routes: [
    {path:'/',component:HelloContainer},
		//2.挂载到路由器让服务器可以访问
    {path:'/Home',component:Home},
    {path:'/product',component:product},
    {path:'/book_list',component:book_list},
    {path:'/Oneline',component:Oneline},
    {path:'/trade',component:trade},
    {path:'/Bookul',component:Bookul},
    {path:'/BookMall',component:BookMall},
    {path:'/Login',component:Login},
  ]
})
